import React, {Component} from 'react';
import CardList from './CardList';
import { robots } from './robots';
import Searchbox from './Searchbox';


class App extends Component{

    constructor(){

        this.state = {
            robots: robots,
            seachfield: ""
        }
    }

    render(){
        return ( 
            <div className="tc">
                <h1>Robo Friends</h1>
                < Searchbox />
                <CardList robots={ robots }/> 
            </div>
        );
    }


}




export default App;
